import "./App.css";
import React from "react";
import { BrowserRouter } from "react-router-dom";
import { Navbar } from "./Components/Navbar/Navbar";
import { WelcomePage } from "./Components/Welcome/Welcome";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <div className="container">
          <section>
            <Navbar />
          </section>
          <WelcomePage />
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
